import React from 'react';
import { ITablistProps } from '../types/types';
import Tab from './Tab';

const Tablist = (props: ITablistProps): JSX.Element => {

    return (
        <>
            <div className="sidebar-tabs">
                <ul role="tablist">
                    <Tab isActive={false} href='#home' faIcon='fa fa-bars' />
                    <Tab isActive={false} href='#database' faIcon='fa fa-database' />
                </ul>

                <ul role="tablist">
                    <Tab isActive={true} href='#settings' faIcon='fa fa-cogs' />
                    <Tab isActive={false} href='#off' faIcon='fa fa-power-off' />
                </ul>
            </div>
        </>
    )
}

export default Tablist;
